import React from "react";
import Button from "react-bootstrap/es/Button";
import axios from "axios";

class Examples extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      example_number: 1,
      loading: false,
      data: [],
      tableReady: false
    };
    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleChange = this.handleChange.bind(this);
  }
  handleSubmit(event) {
    console.log(this.example_number);
    event.preventDefault();
    this.setState({ loading: true }, () => {
      axios.defaults.headers.common = {};
      axios.defaults.headers.common.accept = 'application/json';
      axios
        .post("http://localhost:5000/api/runExample", {info: `${this.example_number}`})
        .then(res => {
          return res.data;
        })
        .then(data => {
          console.log(data.data);
          this.setState({
            loading: false,
            data: data.data,
            tableReady: true
          });
          /**
           * Not Really Used anymore but still could be used later
           */
          //localStorage.setItem("data", JSON.stringify(this.state.data));
          /**
           * Pushes the data to the Reports page and redirects to that page
           */
          this.props.history.push({
            pathname: "/Report",
            state: {
              data: this.state.data
            }
          });
        });
    });
  };
  handleChange(event) {
    this.setState({example_number: event.target.value});
  };
  render() {
    let examples = [
      "1 CIE F1",
      "2 CIE F2",
      "3 CIE F3",
      "4 CIE F4",
      "5 CIE F5",
      "6 CIE F6",
      "7 CIE F7",
      "8 CIE F8",
      "9 CIE F9",
      "10 CIE F10",
      "11 CIE F11",
      "12 CIE F12",
      "13 F32T8/930",
      "14 F32T8/950",
      "15 F34T12/CW/RS/EW",
      "16 F34T12/LW/RS/EW",
      "17 F34T12/WW/RS/EW",
      "18 F40T12/C50 (1)",
      "19 F40T12/C50 (2)",
      "20 F40T12/C75 (1)",
      "21 F40T12/C75 (2)",
      "22 F40T12/CWX (1)",
      "23 F40T12/CWX (2)",
      "24 F40T12/DX (1)",
      "25 F40T12/DX (2)",
      "26 F40T12/DXTP (1)",
      "27 F40T12/DXTP (2)",
      "28 F40T12/N (1)",
      "29 F40T12/N (2)",
      "30 F32T8/730",
      "31 F32T8/735",
      "32 F32T8/741",
      "33 F32T8/750",
      "34 F32T8/830 (1)",
      "35 F32T8/830 (2)",
      "36 F32T8/830 (3)",
      "37 F32T8/835 (1)",
      "38 F32T8/835 (2)",
      "39 F32T8/835 (3)",
      "40 F32T8/841 (1)",
      "41 F32T8/841 (2)",
      "42 F32T8/841 (3)",
      "43 F32T8/850 (1)",
      "44 F32T8/850 (2)",
      "45 F32T8/850 (3)",
      "46 F32T8/865 (1)",
      "47 F32T8/865 (2)",
      "48 F40T12/30U",
      "49 F40T12/35U",
      "50 F40T12/41U"
    ];
    let optionItems = examples.map(example => (
      <option key={example} value={example}>{example}</option>
    ));

    return (
      <form onSubmit={this.handleSubmit}>
        <select value={this.state.example_number} onChange={this.handleChange}>{optionItems}</select>
        <br />
          <Button bsSize="sm" type="submit">Calculate</Button>
      </form>
    );
  }
}

export default Examples;
